import React, { useState, useEffect } from "react";
import styled from "styled-components";
import { Link } from "react-router-dom";

const NavbarContainer = styled.nav`
  width: 100%;
  height: ${(props) => (props.extendNavbar ? "100vh" : "80px")};
  background-color: black;
  display: flex;
  flex-direction: column;
  @media (min-width: 700px) {
    height: 80px;
  }
`;

const LeftContainer = styled.div`
  flex: 70%;
  display: flex;
  align-items: center;
  padding-left: 5%;
`;

const RightContainer = styled.div`
  flex: 30%;
  display: flex;
  justify-content: flex-end;
  align-items: center;
  padding-right: 50px;
`;

const NavbarInnerContainer = styled.div`
  width: 100%;
  height: 80px;
  display: flex;
`;

const NavbarLinkContainer = styled.div`
  display: flex;
  align-items: center;
`;

const NavbarLink = styled(Link)`
  color: white;
  font-size: 18px;
  font-family: Arial, Helvetica, sans-serif;
  text-decoration: none;
  margin: 10px;
  @media (max-width: 700px) {
    display: none;
  }
`;

const NavbarLinkExtended = styled(Link)`
  color: white;
  font-size: 18px;
  font-family: Arial, Helvetica, sans-serif;
  text-decoration: none;
  margin: 10px;
`;

const Logo = styled(Link)`
  margin: 10px;
  color: white;
  font-size: 2rem;
  font-weight: bold;
  text-decoration: none;
`;

const OpenLinksButton = styled.button`
  width: 70px;
  height: 50px;
  background: none;
  border: none;
  color: white;
  font-size: 45px;
  cursor: pointer;
  @media (min-width: 700px) {
    display: none;
  }
`;

const NavbarExtendedContainer = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  @media (min-width: 700px) {
    display: none;
  }
`;

const AuthLinks = styled.div`
  display: flex;
  align-items: center;
  @media (max-width: 700px) {
    display: none;
  }
`;

const AuthLink = styled(Link)`
  color: white;
  font-size: 16px;
  text-decoration: none;
  margin: 0 10px;
  padding: 8px 16px;
  border: 1px solid white;
  border-radius: 4px;
  &:hover {
    background-color: white;
    color: black;
  }
`;

function Navbar() {
  const [extendNavbar, setExtendNavbar] = useState(false);
  const [user, setUser] = useState(null);

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (token) {
      try {
        const base64Payload = token.split('.')[1];
        const payload = JSON.parse(atob(base64Payload));
        setUser(payload);
      } catch (error) {
        console.error('Error decoding token:', error);
        localStorage.removeItem('token');
      }
    }
  }, []);

  const handleLogout = () => {
    localStorage.removeItem('token');
    setUser(null);
    window.location.href = '/';
  };

  return (
    <NavbarContainer extendNavbar={extendNavbar}>
      <NavbarInnerContainer>
        <LeftContainer>
          <NavbarLinkContainer>
            <NavbarLink to="/">Home</NavbarLink>
            <NavbarLink to="/products/men">Men</NavbarLink>
            <NavbarLink to="/products/women">Women</NavbarLink>
            <NavbarLink to="/products/electronics">Electronics</NavbarLink>
            <NavbarLink to="/cart">Cart</NavbarLink>
            <OpenLinksButton
              onClick={() => {
                setExtendNavbar((curr) => !curr);
              }}
            >
              {extendNavbar ? <>&#10005;</> : <>&#8801;</>}
            </OpenLinksButton>
          </NavbarLinkContainer>
        </LeftContainer>
        <RightContainer>
          <AuthLinks>
            {user ? (
              <>
                <span style={{ color: 'white', margin: '0 10px' }}>
                  Hello, {user.email}
                </span>
                <AuthLink as="button" onClick={handleLogout} style={{ background: 'none', border: '1px solid white', cursor: 'pointer' }}>
                  Logout
                </AuthLink>
              </>
            ) : (
              <>
                <AuthLink to="/login">Login</AuthLink>
                <AuthLink to="/register">Register</AuthLink>
              </>
            )}
          </AuthLinks>
          <Logo to="/">QuickCart</Logo>
        </RightContainer>
      </NavbarInnerContainer>
      {extendNavbar && (
        <NavbarExtendedContainer>
          <NavbarLinkExtended to="/">Home</NavbarLinkExtended>
          <NavbarLinkExtended to="/products/men">Men</NavbarLinkExtended>
          <NavbarLinkExtended to="/products/women">Women</NavbarLinkExtended>
          <NavbarLinkExtended to="/products/electronics">Electronics</NavbarLinkExtended>
          <NavbarLinkExtended to="/cart">Cart</NavbarLinkExtended>
          {user ? (
            <>
              <NavbarLinkExtended to="/profile">Profile</NavbarLinkExtended>
              <NavbarLinkExtended onClick={handleLogout} to="/">
                Logout ({user.email})
              </NavbarLinkExtended>
            </>
          ) : (
            <>
              <NavbarLinkExtended to="/login">Login</NavbarLinkExtended>
              <NavbarLinkExtended to="/register">Register</NavbarLinkExtended>
            </>
          )}
        </NavbarExtendedContainer>
      )}
    </NavbarContainer>
  );
}

export default Navbar;
